import React from 'react';
export default {

    tableHeader: (props) => {
        let o = Object.keys(props.data[0]);
        return o.map((key)=>{
                return <th key={key}>{key.toUpperCase()}</th>
                })
    },

    tableRow: (props) =>{
            let lengthOfProps = props.length;
            return props.map((row)=>{
                return <tr >{ Object.values(row)}</tr>
                })

    }

}
